using System;
using System.Linq;

namespace AlloySample.Plugins
{
    public class LoremIpsumGenerator
    {
        private int _numberOfDots;
        private Random _random;
        const int numberOfSentences = 3;

        public LoremIpsumGenerator()
        {
            _numberOfDots = Text.Count(x => x == '.');
            _random = new Random((int) DateTime.Now.Ticks);
        }

        public string GetRandomText()
        {
            var start = _random.Next(_numberOfDots - numberOfSentences);
            var startIndex = IndexOfNth(start) + 1;
            var endIndex = IndexOfNth(start + numberOfSentences);
            var result = Text.Substring(startIndex, endIndex - startIndex);
            return result;
        }

        public static int IndexOfNth(int nth = 0)
        {
            var offset = Text.IndexOf(".", StringComparison.Ordinal);
            for (var i = 0; i < nth; i++)
            {
                if (offset == -1) return -1;
                offset = Text.IndexOf(".", offset + 1, StringComparison.Ordinal);
            }

            return offset;
        }

